script: |
  super -f text -I q10240.spq | sort > q10240.out

inputs:
  - name: q10240.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 46 * + + col2 - + - col0 IN ( - - 69 / - - col1 + + - ( - + col2 ), - 86 * - - col0 );
  - name: tab2

outputs:
  - name: q10240.out
    data: |
      46	51	23
      64	77	40
      75	67	58
